import React, {useState} from 'react'
import "./Signinbtn.css"
import {SignInWithGoogle} from '../auth/auth'

const Signinbtn = () => {
    const handleClick = () => {
        SignInWithGoogle();
    }
    return (
        <div className='btn' onClick={handleClick} >
            Sign in with Google
        </div>
    )
}

export default Signinbtn
